Description:
Designed for the avid traveling diver in mind, the Armada rear inflation BC is both compact and light-weight to allow easy packing in a suitcase. Underwater this BC design translates into streamlined fit and low profile maneuverability that makes diving truly effortless.<font face="Times New Roman"><span style="font-size: 10pt; font-family: 'Comic Sans MS';"></span></font><br />
<font face="Times New Roman"> </font>
<ul>
    <li><span style=""><span style=""><span style="font-family: &quot;Times New Roman&quot;; font-style: normal; font-variant: normal; font-weight: normal; font-size: 7pt; line-height: normal; font-size-adjust: none; font-stretch: normal;"> </span></span></span><!--[endif]-->3-D rear inflation aircell design for increased buoyancy</li>
    <li><span style="background: yellow none repeat scroll 0% 0%; -moz-background-clip: -moz-initial; -moz-background-origin: -moz-initial; -moz-background-inline-policy: -moz-initial;">Detachable aircell</span> &ndash; replaceable in case of damage</li>
    <li>Patented SLQR (Secure-Lock-Quick-Release) weight-integrated release system </li>
    <li><span style=""><span style=""><span style="font-family: &quot;Times New Roman&quot;; font-style: normal; font-variant: normal; font-weight: normal; font-size: 7pt; line-height: normal; font-size-adjust: none; font-stretch: normal;"></span></span></span><!--[endif]-->Two quick-release weight pockets (max integrated weight 10 lbs per side) </li>
    <li>Two rear weight pockets (max 5 lbs per side) <span style="">&nbsp;&nbsp;</span><span style="">&nbsp;</span> </li>
    <li>Rugged 840 Denier TPU nylon aircell construction </li>
    <li>Balanced Superior Inflator inflates and deflates at a touch of a button</li>
    <li>Lower rear pull dump valve and integrated shoulder pull dump airway valve</li>
    <li>Stable padded hard pack with built-in carry handle<span style=""></span> </li>
    <li>Rolled neoprene neck collar</li>
    <li>Quick-release adjustable shoulder buckles</li>
    <li>Flexible cummerbund with quick-release buckles</li>
    <li>Adjustable integrated chest strap with quick-release buckles</li>
    <li><span style=""><span style=""><span style="font-family: &quot;Times New Roman&quot;; font-style: normal; font-variant: normal; font-weight: normal; font-size: 7pt; line-height: normal; font-size-adjust: none; font-stretch: normal;"> </span></span></span><!--[endif]-->Two large 1000 Denier Nylon zippered pockets w/YKK #10 zippers</li>
    <li><span style=""><span style=""><span style="font-family: &quot;Times New Roman&quot;; font-style: normal; font-variant: normal; font-weight: normal; font-size: 7pt; line-height: normal; font-size-adjust: none; font-stretch: normal;"></span></span></span><!--[endif]-->5 stainless steel and 2 Delren D-rings</li>
    <li>Integrated knife mounting grommet</li>
</ul>
&nbsp; *Larger sizes available upon request
